import React, { Component, Fragment } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import '../../asset/css/custom-styles.css'; // Replace with the correct CSS file path
import Carousel from 'react-bootstrap/Carousel';




class Slider extends Component {
  render() {
    return (
   <Fragment>

    <Carousel>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={imagefirst} 
          alt="Slide1"
          style={{ height: '700px' }}
        />
        <Carousel.Caption>
          <h3 style={{ color: 'white' }}>Travel to the land of greenery</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={imagesecond}
          alt="Slide2"
          style={{ height: '700px' }}

        />

        <Carousel.Caption>
          <h3 style={{ color: 'white' }}>Countless beaches to visit and relax</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={imagethird}
          alt="Slide3"
          style={{ height: '700px' }}
        />

        <Carousel.Caption>
          <h3 style={{ color: 'white' }}>Travel with us to enjoy countless more sunsets</h3>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>

   </Fragment>
    )
  }
}

export default Slider



